      Overview:"A dosa, also called dosai, is a thin pancake in South Indian cuisine made from a fermented batter of ground black lentils and rice. Dosas are popular in South Asia as well as around the world. Dosas are served hot, often with chutney and sambar.",
      description: "  The thin pancake known as dosa is one of the most famous Indian dishes. It is made with soaked rice and black gram beans, which are ground into a paste and mixed to create a thick batter, usually left to ferment overnight. The mixture is enriched with a handful of fenugreek seeds, which give dosa its distinctive golden brown color and a delicious, crispy texture.It is then baked on a hot oiled griddle, pertaining a delicate, thin texture and round shape. Indian dosa is a staple dish in the entire country, but some believe that dosa had originated in the south Indian state of Tamil Nadu. It is an ancient dish, whose origins are traced back to the 1st century AD, when it was first mentioned in Tamil literature.Others claim that it's linked to Udupi (present day Karnataka) due to the association with the Udupi restaurants. Usually, dosa is consumed as a savory dish, commonly eaten for breakfast, dinner, or a quick snack. Since it has a rather neutral taste, dosa is an ideal accompaniment to many luscious Indian dishes, such as meat and vegetable curries or chutneys."
