      Overview:"Momo is a type of steamed filled dumpling with origins from the Himalayan region that is popular in Tibet, Bhutan, Nepal and India.",
      description: "In Newari, one of Nepal’s oldest languages, ‘mome’ means cooking by steaming. ‘Momo’ is to Nepal what pizza is to Italy, and is available in every restaurant, hotel and household of Katmandu and other parts of Nepal. Momo is like Mount Everest – one of the symbols of Nepal. Now its popularity has spread beyond national boundaries and, thanks largely to Nepalese communities living abroad, it is growing popular in other parts of the world, too. There are other reasons for momo’s increasing popularity of momo. First, it is cheap. The price of momo varies from ten rupees for one plate (10 to 12 pieces) to 100 rupees. A plate of momo is enough for a light lunch. Second comes the taste. Momo is prepared with special spices, which add unique and original taste to suit the Nepalese palate. The third reason is momo’s long history. Momo has figured on Nepalese menus for centuries and ithas become part of the national culture. The fourth is its availability. It is found in every corner of the country and every restaurant and hotel, big or small. So how is momo prepared and what are the ingredients? Momo is made from wheat flour, vegetable oil, chopped onion, garlic, sesame, green chilies, tomatoes, meat (preferably beef), mustard powder, ginger juice and a blend of Nepalese herbal spices. First, pour water into the wheat flour and knead the resulting dough into a smooth paste. Then mold into small, thin discs. Grind the meat into a paste and mix in the chopped onion, garlic and ginger juice. Then add the vegetable oil and spices and blend well. Spread the mixture of meat, garlic, onion and spices onto each disc and fold into a half-moon shape."
